import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

function AdminForm() {
  const [serviceName, setServiceName] = useState("");
  const [serviceDescription, setServiceDescription] = useState("");
  const [document1, setDocument1] = useState("");
  const [document2, setDocument2] = useState("");
  const [document3, setDocument3] = useState("");
  const [image, setImage] = useState(null);
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();

    // Create the new service object
    const serviceData = {
      name: serviceName,
      description: serviceDescription,
      documents: [document1, document2, document3],
      image:
        image ||
        "https://mamatafertility.com/wp-content/themes/consultix/images/no-image-found-360x250.png",
    };

    setLoading(true);

    try {
      const response = await axios.post(
        "http://localhost:5000/api/services",
        serviceData
      );
      console.log("Service added successfully:", response.data);

      // Redirect back to the services page after successful addition
      navigate("/");
    } catch (error) {
      console.error("Error adding service:", error.response?.data || error.message);
      alert("Error adding service. Please check the details and try again.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="p-8 bg-gray-50 min-h-screen flex flex-col items-center">
      <h1 className="text-3xl font-bold text-gray-800 mb-6">Add New Service</h1>

      <form
        onSubmit={handleSubmit}
        className="w-full max-w-lg bg-white shadow-md rounded-lg p-6 space-y-6"
      >
        {/* Service Name */}
        <div>
          <label
            htmlFor="serviceName"
            className="block text-sm font-medium text-gray-700"
          >
            Service Name
          </label>
          <input
            type="text"
            id="serviceName"
            value={serviceName}
            onChange={(e) => setServiceName(e.target.value)}
            required
            className="mt-1 w-full p-2 border rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500"
          />
        </div>

        {/* Service Description */}
        <div>
          <label
            htmlFor="serviceDescription"
            className="block text-sm font-medium text-gray-700"
          >
            Service Description
          </label>
          <textarea
            id="serviceDescription"
            value={serviceDescription}
            onChange={(e) => setServiceDescription(e.target.value)}
            required
            className="mt-1 w-full p-2 border rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500"
          />
        </div>

        {/* Document Fields */}
        <div>
          <label
            htmlFor="document1"
            className="block text-sm font-medium text-gray-700"
          >
            Document 1
          </label>
          <input
            type="text"
            id="document1"
            value={document1}
            onChange={(e) => setDocument1(e.target.value)}
            required
            className="mt-1 w-full p-2 border rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500"
          />
        </div>

        <div>
          <label
            htmlFor="document2"
            className="block text-sm font-medium text-gray-700"
          >
            Document 2
          </label>
          <input
            type="text"
            id="document2"
            value={document2}
            onChange={(e) => setDocument2(e.target.value)}
            required
            className="mt-1 w-full p-2 border rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500"
          />
        </div>

        <div>
          <label
            htmlFor="document3"
            className="block text-sm font-medium text-gray-700"
          >
            Document 3
          </label>
          <input
            type="text"
            id="document3"
            value={document3}
            onChange={(e) => setDocument3(e.target.value)}
            required
            className="mt-1 w-full p-2 border rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500"
          />
        </div>

        {/* Image Upload */}
        <div>
          <label
            htmlFor="image"
            className="block text-sm font-medium text-gray-700"
          >
            Upload Image
          </label>
          <input
            type="file"
            id="image"
            onChange={(e) => setImage(URL.createObjectURL(e.target.files[0]))}
            className="mt-1 w-full p-2 border rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500"
          />
        </div>

        {/* Submit Button */}
        <div>
          <button
            type="submit"
            disabled={loading}
            className={`w-full py-2 px-4 text-white font-semibold rounded-md ${loading
                ? "bg-gray-400 cursor-not-allowed"
                : "bg-blue-500 hover:bg-blue-600 focus:ring focus:ring-blue-300"
              }`}
          >
            {loading ? "Adding Service..." : "Add Service"}
          </button>
        </div>
      </form>
    </div>
  );
}

export default AdminForm;
